import React from "react";
import { Task } from "../../types/index";

interface itemOne {
  item: Task;
}

export const TodoTask = ({ item }: itemOne) => {
  return (
    <div className="todotask__wrapper">
      <div className="ckeckbox"></div>
      <div className="title">{item.title}</div>
      <div className="cross"></div>
    </div>
  );
};
